import React from 'react';
import CircularProgressBar from './CircularProgressBar';

// import Chart from './Chart.jsx';

const Tail = (props) => {
  return (
    <div className="w3-container w3-round-xlarge w3-light-gray tail" style={{ height: '130px'}} >
      <div className="w3-padding w3-display-container" >
        <div className="w3-display-right" style={{ height: '100%', marginTop: '0.5em'}} >
          <CircularProgressBar
               strokeWidth="8"
               sqSize="60"
               percentage={75}/>
        </div>
      </div>
      <div className="w3-container" style={{ width: '100%', marginTop: '2.5em' }}>
        <p className="w3-text-grey" style={{  marginBottom: '0.2em' }} ><b>{props.name || "Tail Name"}</b></p>
      </div>
    </div>
    );
}

export default Tail;
